import React from 'react';
import GoogleLogin from 'react-google-login';
import FacebookLogin from 'react-facebook-login';
import axios from 'axios';
//create client id from console.cloud.google.com

function App() {

  const responsesuccessGoogle = (response) => {
      console.log(response);
      //const data =  {tokenId: response.tokenId};

        axios({
          method: "POST",
          url: "http://localhost:5000/auth/googlelogin",
          data: {tokenId: response.tokenId},

        }).then(res => {
          console.log("Google Login done Successfully!", res);
        });
  }

  const responseerrorGoogle = (response) => {
      console.log("Lgin failure");
  }

  const responseFacebook = (response) => {
    console.log(response);
}

  return (
    <div>
      <h1>Login with Google</h1>
      <GoogleLogin
        clientId="591588852378-t10b511pn84lgs8ubbm0kgm7i9ai1svp.apps.googleusercontent.com"
        buttonText="Login with Google"
        onSuccess={responsesuccessGoogle}
        onFailure={responseerrorGoogle}
        cookiePolicy={'single_host_origin'}
      />
      <h1>Login with Facebook</h1>
      <FacebookLogin
    appId="396983315053767"
    autoLoad={false}
    callback={responseFacebook} />
    </div>
  )
}

export default App;
